import axios from "axios";

export const getText = () => {
  let study_periods = [];
  let exam_periods = [];
  let reexam_periods = [];
  axios.get("http://localhost:5000/getDataJson").then(res => {
    study_periods = res.data.study_periods;
    console.log("done");
    exam_periods = res.data.exam_periods;
    reexam_periods = res.data.reexam_periods;
  });
  console.log(study_periods);
  console.log(exam_periods);
  console.log(reexam_periods);
};

export default getText;
